    import {Button, NavBar} from 'vant'

    export default {
        components: {
            [NavBar.name]: NavBar,
            [Button.name]: Button
        },
        data() {
            return {
                message: ''
            }
        },
        mounted() {
            this.init()
        },
        methods: {
            init() {
                this.message = this.$route.query.message
                console.log('message', this.message)
            }
        }
    }
